## Describe the problem

No action when press negative button from EasyPermissions.requestPermissions()  inside fragment.

I expected that dialog will appear again.

In version 1.1.1 everything is OK.

All methods are from the box, nothing new.

If we call `EasyPermissions.requestPermissions` from Fragment and show rational dialog:

```java
    @Override
    public void showRequestPermissionRationale(@NonNull String rationale,
                                               @NonNull String positiveButton,
                                               @NonNull String negativeButton,
                                               @StyleRes int theme,
                                               int requestCode,
                                               @NonNull String... perms) {

        FragmentManager fm = getSupportFragmentManager();
```
https://github.com/googlesamples/easypermissions/blob/master/easypermissions/src/main/java/pub/devrel/easypermissions/helper/BaseSupportPermissionsHelper.java#L32

```java
    @Override
    public FragmentManager getSupportFragmentManager() {
        FragmentActivity hostActivity = getHost().getActivity();
        if (hostActivity != null) {
            return hostActivity.getSupportFragmentManager();
        } else {
            return getHost().getChildFragmentManager();
        }
    }
```

This will return hostActivity.getSupportFragmentManager(), causing request permissions using `ActivityCompat.requestPermissions(xxx)`, this way the host fragment can't receive `onRequestPermissionsResult`, only its host Activity.

if using proguard optimization, a @AfterPermissionGranted method could be completly inlined preventing EasyPermissions.onRequestPermissionsResult to find it.

    private static final int REQUEST_PERMISSION = 10;

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        navigateToPlayer();
    }

    @Keep
    @AfterPermissionGranted(REQUEST_PERMISSION)
    private void navigateToPlayer() {
        if (EasyPermissions.hasPermissions(this, Manifest.permission.READ_EXTERNAL_STORAGE)) {
            Intent intent = new Intent(this, MusicPlayerActivity.class);
            startActivity(intent);
            finish();
        } else {
            EasyPermissions.requestPermissions(this, getString(R.string.read_permission_rational), REQUEST_PERMISSION, Manifest.permission.READ_EXTERNAL_STORAGE);
        }
    }

    @Override
    public void onRequestPermissionsResult(int requestCode, @NonNull String[] permissions, @NonNull int[] grantResults) {
        super.onRequestPermissionsResult(requestCode, permissions, grantResults);

        // Forward results to EasyPermissions
        EasyPermissions.onRequestPermissionsResult(requestCode, permissions, grantResults, this);
    }

`for (Method method : clazz.getDeclaredMethods()) {
            if (method.isAnnotationPresent(AfterPermissionGranted.class)) {
               /* more code */
            }
        }`

When using a base class (e.g. BaseFragment) which has annoteated AfterPermissionGranted methods  then these are not run. The reason seems to be that clazz.getDeclaredMethods() only returns the methods which are declared in the class itself and not the superclass ones. 

This might be intented behaviour, but just wanted to check.

